    setData(childdata);
  }

  return (
    <div className="main-row">     
      <div className="block">
      <Sidebar childToParent={childToParent}></Sidebar>
      </div>
      <div className="block align-top">
      {data}
      </div>
    </div>
  );
}

export default App;
